import { useState } from "react";
import "./TestingFile.css";

const TestingMyReactKnowledge = (props) => {
  const [enteredTitle, setEnteredTitle] = useState("");
  const [enteredAmount, setEnteredAmount] = useState("");
  const [enteredDate, setEnteredDate] = useState("");

  const setEnteredTitleHandler = (event) => {
    setEnteredTitle(event.target.value);
  };

  const setEnteredAmountHandler = (event) => {
    setEnteredAmount(event.target.value);
  };

  const setEnteredDateHandler = (event) => {
    setEnteredDate(event.target.value);
  };

  const submitHandler = () => {
    const expenseData = {
      title: enteredTitle,
      amount: enteredAmount,
      date: new DaenteredDate,
    };

    console.log(expenseDatate);
    props.onSaveExpenseNewData(expenseData);
  };

  return (
    <form onSubmit={submitHandler}>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title</label>
          <input type="text" onChange={setEnteredTitleHandler} />
        </div>
        <div className="new-expense__control">
          <label>Amount</label>
          <input
            type="number"
            min="0.01"
            step="0.01"
            onChange={setEnteredAmountHandler}
          />
        </div>
        <div className="new-expense__control">
          <label>Date</label>
          <input
            type="date"
            min="2019-01-01"
            max="2025-12-31"
            onChange={setEnteredDateHandler}
          />
        </div>
      </div>
      <div className="new-expense__actions">
        <button type="submit">Add Expense</button>
      </div>
    </form>
  );
};

export default TestingMyReactKnowledge;
